import java.text.SimpleDateFormat;



for (int i=0;i<2;i++){
	Date date = new Date();
	Random randm = new Random();

	int month1 = date.getMonth()-(randm.nextInt(2)+1);

	Random rand = new Random();

	Random randm1 = new Random();
	int month=randm1.nextInt(1+date.getMonth()-month1) + month1;

if (date.getMonth()==month){
		days = rand.nextInt(date.getDate())+1;
	}
	else if (month==2 && date.getMonth()!=month){
			days = rand.nextInt(28)+1;
		}
		else {
				days = rand.nextInt(30)+1;
			}

	date.setMonth (month);
	date.setDate(days);
	date.setYear(date.getYear())

// Some examples
formatter = new SimpleDateFormat("yyyy-MM-dd");
String s = formatter.format(date);
context.getTestCase().getTestStepByName("orderValues").setPropertyValue("orderDate", "'" + s + "'");
// 01/09/02

	testRunner.runTestStepByName("JDBC Request Create Order");
}

